import React, { Component } from 'react';
import './App.css';


let selectedStyle = {
  color: '#fff',

}

class Aggregate extends Component
{
  render()
  {
    return(
      <div style={{...selectedStyle, with: "100%", display: 'inline-block'}}>
        <h2>
          Number Text   
        </h2>
      </div>
    );
  }
}

class Filter extends Component
{
  render()
  {
    return(
      <div style={{...selectedStyle}}>
        <img/>
          <input type="text"/>
      </div>
    );
  }
}


class Playlist extends Component
{
  render()
  {
    return(
    <div style={{...selectedStyle,display: 'inline-block', width: "25%"}}>
      <img/>
      <h3>
        Playlist Name
      </h3>
      <ul>
        <li>
          Song 1
        </li>
        <li>
          Song 2
        </li>
        <li>
          Song 3
        </li>
      </ul>
    </div>);
  }
}

class App extends Component 
{
  render() 
  { 
    return (
      <div className="App">
        <h1 style={{width: "10%"}}>
          Title
        </h1>

        <Aggregate/>
        <Aggregate/>

        <Filter/>

        <Playlist/>
        <Playlist/>
        <Playlist/>
        <Playlist/>

      </div>
    );
  }
}

export default App;
